import {Button, Card, Col, Container, FloatingLabel, Form, ListGroup, Row} from "react-bootstrap";
import {useState} from "react";
import CountryInput from "./CountryInput";
import CountryList from "./CountryList";
import ajax from "../api/ajax";

function CountryBox() {

    const [dataWholeCountries, setDataWholeCountries] = useState(T_dataCountries);

    function onInsert() {
        console.log(dataWholeCountries);
        // dataWholeCountries.forEach((country) => {

        // });
    }

    async function insertCountry(country) {
        console.log("Insert New Whole Countries");
        await ajax("api/countries/insert", {name: "nnn"}, 'POST').then(e => {
            console.log("-- node list ajax body --");
            console.log(e.data);
        });
        // return T_dataCountries;
    }

    return (

        <div className="App">
            <header className="App-header">
            </header>
            <main>
                <Container xs={5}>
                    <Row className="justify-content-center">
                        <Col xs={5}>
                            <Card className="p-3 shadow-sm navbar-nav-scroll">
                                <Row>
                                    <Col>
                                        <Button variant="danger">Danger</Button>{' '}
                                        <Button variant="primary"
                                                onClick={onInsert}
                                        >Insert</Button>{' '}
                                    </Col>
                                </Row>
                                <Row>
                                    <Col>
                                        <Form.Control as="textarea" rows={3}
                                                      value={(()=>{
                                                          return dataWholeCountries.map((o)=>{
                                                              return o.name;
                                                          }).join('\n');
                                                      })()}
                                                      onChange={(e) => {
                                                          // console.log(e.target.value.split(/\r?\n/));
                                                          setDataWholeCountries(
                                                              e.target.value.split(/\r?\n?,?\\n/).map((item) => {
                                                                  return {name: item}
                                                              }));
                                                      }}/>
                                    </Col>
                                </Row>
                            </Card>
                        </Col>
                    </Row>
                </Container>
            </main>
        </div>
    );
}


async function loadCountries(iniData) {
    console.log("ini Data ====== ");
    await ajax("api/testing/select", {}).then(e => {
        console.log("-- node list ajax body --");
        console.log(e.data);
        iniData(e.data);
    });
    // return T_dataCountries;
}

export default CountryBox;

